        FORTNITE_GIFT_INVENTORY_INFO:
          "Hol dir deine Ausr\xfcstung passend f\xfcr dein {guardOutfitName}!\n\nAb dem 4. Mai kannst du auf zwei Arten den {rewardName}-Discord-Drop freischalten:\n\nStreame live und \xfcbertrage mindestens 15 Minuten lang Fortnite auf Discord f\xfcr mindestens einen Discord-Freund.\n\nNach 15 Minuten Bildschirm\xfcbertragung an einen Freund erh\xe4ltst du einen Link als Geschenk unter deinen Einstellungen > Geschenkinventar.\n\nKlick auf den Link, um dich in deinen Epic Games-Account einzuloggen und die Lackierung wird deinem Fortnite-Spind hinzugef\xfcgt!\n\nDu kannst nicht streamen? Dann kannst du auch die Discord-Bot-Quest annehmen! Tritt dem [offiziellen Fortnite-Discord-Server](http://discord.gg/fortnite) bei, um anzufangen.\n\nIm Server kannst du mit einem Bot interagieren, um an der Discord-Quest teilzunehmen.\n\nNachdem du mit dem Bot interagiert hast, wirst du auf eine Seite weitergeleitet, auf der du deine Epic- und Discord-Accounts verbinden kannst.\n\nWenn deine Accounts verbunden sind, nimmst du an der Quest teil, indem du eine Aufgabe in Discord und eine in Fortnite abschlie\xdft.\n\nNach Abschluss dieser beiden Aufgaben wird die Lackierung deinem Fortnite-Spind hinzugef\xfcgt!\n\nMehr erf\xe4hrst du in unserem Blog!\n",
